      "id": "UgymZiI2icLZcfFutwZ4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "LuuZUI6P0ibiSfUe5e4F4QpCBlY",
          "id": "UgymZiI2icLZcfFutwZ4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "I had struggled with this for years, despite being a physicist and engineer. \u003cbr\u003e\u003cbr\u003eThe problem is that the thought experiments on this topic are fallible in many ways, if taken too literally.\u003cbr\u003e[For example, what if the clock tower was on a train moving away at the speed of light from a stationary observer, or if the observer was on a train that started on an approach to the clock tower, then continued past at the speed of light?] \u003cbr\u003eFor me it took a completely different perspective to understand it, building it up in stages:\u003cbr\u003e\u003cbr\u003e1) If every particle in the universe was static with respect to each other, there would be no interactions, and it would seem time had stood still, because nothing is changing. For time to become apparent, particles need to move and interact with each other, energy has to flow.\u003cbr\u003e2) The speed of light is a universal constant. Do not consider light as an object, like a ball moving through space. It is a limit on how fast events in one region of space can cause events in other regions of space (&quot;causality&quot;).\u003cbr\u003e3) If you were travelling at the speed of light, the atoms and particles that make up your body would not be able to move in the direction of travel (relative to the centre of your body), since they would have to travel faster than the speed of light (violating causality...the outermost molecules of your body would arrive at your destination slightly before you should be able to arrive!). Hence all the particles in your body would actually be static relative to each other, and therefore you wouldn&#39;t be ageing. Furthermore, you wouldn&#39;t be able to have a conscious appreciation that your ageing had ceased, since even &quot;thinking&quot; would require movement and interaction between the particles in your brain.\u003cbr\u003e4) Since any object&#39;s perception of time is relative to the &quot;relative interactions&quot; of the matter it is made from, it cannot perceive the difference between a tick (at zero speed) or a tick (at near the speed of light....a &quot;tick&quot; is a &quot;tick&quot; according to the object observing or recording its own time. \u003cbr\u003e\u003cbr\u003eDue to the principles of a universal speed of light and causality, moving through space will necessarily slow the mechanism of the moving clock, and by an equal amount, the mechanism by which the moving observer is able to observe the clock. A clock moving through space actually does tick slower than a clock not moving through space.\u003cbr\u003e\u003cbr\u003e[A profound thought regarding point (2): If the speed of light is measured by causality, and causality infers change, and change infers the passing of time....if time didn&#39;t exist, would there be a speed of light? Would there be light?]\u003cbr\u003e\u003cbr\u003eIn the context of this perspective I can go back to the original thought experiments and understand which aspects of them are useful in deriving the maths.\u003cbr\u003e\u003cbr\u003eThese are all my own thoughts. I don&#39;t know if any professor of physics would validate them. But where the original thought experiments left me feeling dissatisfied, this new perspective helped me.",
            "textOriginal": "I had struggled with this for years, despite being a physicist and engineer. \n\nThe problem is that the thought experiments on this topic are fallible in many ways, if taken too literally.\n[For example, what if the clock tower was on a train moving away at the speed of light from a stationary observer, or if the observer was on a train that started on an approach to the clock tower, then continued past at the speed of light?] \nFor me it took a completely different perspective to understand it, building it up in stages:\n\n1) If every particle in the universe was static with respect to each other, there would be no interactions, and it would seem time had stood still, because nothing is changing. For time to become apparent, particles need to move and interact with each other, energy has to flow.\n2) The speed of light is a universal constant. Do not consider light as an object, like a ball moving through space. It is a limit on how fast events in one region of space can cause events in other regions of space (\"causality\").\n3) If you were travelling at the speed of light, the atoms and particles that make up your body would not be able to move in the direction of travel (relative to the centre of your body), since they would have to travel faster than the speed of light (violating causality...the outermost molecules of your body would arrive at your destination slightly before you should be able to arrive!). Hence all the particles in your body would actually be static relative to each other, and therefore you wouldn't be ageing. Furthermore, you wouldn't be able to have a conscious appreciation that your ageing had ceased, since even \"thinking\" would require movement and interaction between the particles in your brain.\n4) Since any object's perception of time is relative to the \"relative interactions\" of the matter it is made from, it cannot perceive the difference between a tick (at zero speed) or a tick (at near the speed of light....a \"tick\" is a \"tick\" according to the object observing or recording its own time. \n\nDue to the principles of a universal speed of light and causality, moving through space will necessarily slow the mechanism of the moving clock, and by an equal amount, the mechanism by which the moving observer is able to observe the clock. A clock moving through space actually does tick slower than a clock not moving through space.\n\n[A profound thought regarding point (2): If the speed of light is measured by causality, and causality infers change, and change infers the passing of time....if time didn't exist, would there be a speed of light? Would there be light?]\n\nIn the context of this perspective I can go back to the original thought experiments and understand which aspects of them are useful in deriving the maths.\n\nThese are all my own thoughts. I don't know if any professor of physics would validate them. But where the original thought experiments left me feeling dissatisfied, this new perspective helped me.",
            "authorDisplayName": "debiddo",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu8ja8826PrDlT_RHRkJcqeFkUK1z02K94mQxQ=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UCOZQ7zY3MHLNb8mj4d6pkvQ",
